import { useState, useEffect } from "react";
import logo_image from "../../../assets/images/Mingle_AI_BI_v1_20231114_black.png";
import banner_image from "../../../assets/images/Banner.png";

function Header(props) {
  const [innerWidth, setInnerWidth] = useState(window.innerWidth);

  useEffect(() => {
    const resizeListener = () => {
      setInnerWidth(window.innerWidth);
    };
    window.addEventListener("resize", resizeListener);
  });

  return (
    <header>
      <h1>
        <img
          src={logo_image}
          alt="Title"
          style={{ width: 50 + innerWidth / 10 }}
          onClick={() => {}}
        />
      </h1>
    </header>
  );
}

function Nav(props) {
  const list = [];

  for (let i = 0; i < props.topics.length; i++) {
    let t = props.topics[i];
    list.push(
      <li key={t.id}>
        <a
          id={t.id}
          href={"/read/" + t.id}
          onClick={(event) => {
            event.preventDefault();
            props.onChangeMode(event.target.id);
          }}
        >
          {t.title}
        </a>
      </li>
    );
  }
  return (
    <nav>
      <ol>{list}</ol>
    </nav>
  );
}

function TryButton(props) {
  return (
    <li>
      <input type="button" value="Try" onClick={() => {}} />
    </li>
  );
}

function Launch_Desktop() {
  const [mode, setMode] = useState("WELCOME");
  const [id, setID] = useState(null);
  const [nextId, setNextId] = useState(4);
  const [topics, setTopics] = useState([
    { id: 1, title: "html", body: "html is ..." },
    { id: 2, title: "css", body: "css is ..." },
    { id: 3, title: "java script", body: "java script is ..." },
  ]);

  let content = null;
  let contextControl = null;

  return (
    <div className="App">
      <Header
        title="Title"
        onChangeMode={() => {
          setMode("WELCOME");
        }}
      ></Header>
      <div style={{ display: "flex" }}>
        <div>
          <img src={banner_image} alt="Title" />
        </div>
        <div>
          Hi Everybody!
          <TryButton></TryButton>
        </div>
      </div>
    </div>
  );
}

export default Launch_Desktop;
